@keristars (just to clarify) not a full mastectomy, insurance won't pay for that unless it's literally life threatening - like cancer.

I will still have breast issue, still need to get cancer screening/imaging/etc

it's just a lot less, and somewhat "sculpted" to not be like boobs

@rinrainren D -  - check out surgeon's specific websites, for examples of *their* work. *two* of the rejection places sent me to a general database and not their own work, that's actually a huge red flag!!

(database+own work is okay tho)

be able to say "I like this, and not that"

@rinrainren also, she's VERY familiar with the letter that needs to be written, and how it needs to be written. and that fact she has worked with this exact surgeon many times before.

all of that is luck!

I didn't start with her in 2012 for ANY of this. I didn't start w/gender till 2019.

@rinrainren they may be able to get yours way smaller and you're satisfied with that. your insurance may be different.

do you have a therapist? do you talk gender with them?

I lucked out that I've been established with mine since 2012, and have discussed sexuality and gender with her a lot

@rinrainren also, turns out because of how much the medical field *really* hates women, it's generally easier to get insurance to pay for top surgery.

so obviously all the signs *for me* where point to top surgery.

but my experience is not universal!

